// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "./CoreCellControls.sol";
import "./IGridToken.sol";

contract CoreGridMining is CoreCellControls {
    /// @dev Address of the BSC-Grid team account
    address payable public financeAccount;

    /// @dev The percentage the team in each ranking earns of each minting reward (measured in basis points)
    uint16[8] public miningDistribution;

    /// @dev The address of the GridToken contract
    IGridToken public gridTokenContract;

    // Measured in basis points (1/100 of a percent). Values 0-10000 map to 0%-100%
    uint256 public bscgridPercentage;

    event TokensMined(uint256 indexed teamId, uint8 ranking, uint256 tokensEarned, uint256 tokensEarnedPerStake, uint64 timestamp);
    event TokensClaimed(uint256 indexed cellId, address indexed owner, uint256 tokensClaimed, uint64 timestamp);

    constructor() {
        financeAccount = payable(msg.sender);
        bscgridPercentage = 1000; //10%

        //Mining rewards based on each team's total staked amount:
        //20% for first place, 16% for second place, etc
        miningDistribution = [2000, 1600, 1400, 1200, 1000, 800, 600, 400];
    }

    /// @param _address - Address to receive proceeds of auctions created by core contract
    function setFinanceAccount(address payable _address) external onlyRole(ROLE_OWNER) {
        financeAccount = _address;
    }

    /// @dev Allows an operator to retrieve funds from the contract into the finance account
    function retrieveFunds() external onlyRole(ROLE_OPERATOR) {
        uint256 _balance = address(this).balance;
        financeAccount.transfer(_balance);
    }

    /// @dev Sets the reference to the GRID token contract
    /// @param _address - Address of the contract
    function setGridTokenContractAddress(address _address) external onlyRole(ROLE_OWNER) {
        IGridToken candidateContract = IGridToken(_address);

        require(
            candidateContract.supportsInterface(type(IGridToken).interfaceId),
            "Contract is not of type GridToken"
        );

        // Set the new contract address
        gridTokenContract = candidateContract;
    }

    /// @dev Mint new tokens and calculate distributions to each team based on their representation on the grid
    /// @param _sortedTeamOrder - The sorted array of teams based on their current grid representation ranking
    /// - arrays are sorted off-chain and passed as an input to avoid gas costs,
    /// - but are verified on chain to ensure data matches contract values (thus avoiding any manipulation)
    /// - team rankings changing between when order is calculated off and on chain will cause a revert
    function mineGridTokens(uint8[8] memory _sortedTeamOrder) external onlyRole(ROLE_OPERATOR) {
        require(address(gridTokenContract) != address(0), "gridTokenContract has not been set");
        require(address(cellContract) != address(0), "cellContract has not been set");

        //get the current team stake values from the CELL contract
        uint256[8] memory _teamStake = cellContract.getAllTeamStakes();
        (uint256[8] memory _teamEarnings, uint256[8] memory _teamEarningsPerStake) = cellContract.getAllTeamEarnings();

        //ensure the off-chain calculated order is correctly sorted
        require(
            (_teamStake[_sortedTeamOrder[0]] >= _teamStake[_sortedTeamOrder[1]]) &&
            (_teamStake[_sortedTeamOrder[1]] >= _teamStake[_sortedTeamOrder[2]]) &&
            (_teamStake[_sortedTeamOrder[2]] >= _teamStake[_sortedTeamOrder[3]]) &&
            (_teamStake[_sortedTeamOrder[3]] >= _teamStake[_sortedTeamOrder[4]]) &&
            (_teamStake[_sortedTeamOrder[4]] >= _teamStake[_sortedTeamOrder[5]]) &&
            (_teamStake[_sortedTeamOrder[5]] >= _teamStake[_sortedTeamOrder[6]]) &&
            (_teamStake[_sortedTeamOrder[6]] >= _teamStake[_sortedTeamOrder[7]]),
            "Sorted team order does not match on-chain data"
        );

        //perform the token minting and return the amount minted
        uint256 _mintedAmount = gridTokenContract.mint();

        //calculate the BSC-Grid team cut
        uint256 _bscgridAmount = (_mintedAmount * bscgridPercentage) / 10000;

        //calculate the amount to distribute amongst teams
        uint256 _distributionAmount = _mintedAmount - _bscgridAmount;

        //team in first place earns the first place mining distribution % of the total distribution amount, etc
        for (uint8 _i = 0; _i < 8; _i++) {
            if (_teamStake[_sortedTeamOrder[_i]] <= 0) {
                continue;
            }

            //calculate number of tokens earned by this team
            uint256 _teamTokensEarned = (_distributionAmount * uint256(miningDistribution[_i])) / 10000;

            //increase team's cumulative total of tokens earned
            _teamEarnings[_sortedTeamOrder[_i]] += _teamTokensEarned;

            //break the earned tokens into per-stake amounts to ensure accuracy of claims
            uint256 _teamTokensEarnedPerStake = _teamTokensEarned / _teamStake[_sortedTeamOrder[_i]];

            //increase team's cumulative total of tokens earned per stake
            _teamEarningsPerStake[_sortedTeamOrder[_i]] += _teamTokensEarnedPerStake;

            //let everyone know about it
            emit TokensMined(_sortedTeamOrder[_i], _i, _teamTokensEarned, _teamTokensEarnedPerStake, uint64(block.timestamp));
        }

        //update stored team total earnings
        cellContract.setAllTeamEarnings(_teamEarnings, _teamEarningsPerStake);

        //distribute BSC-Grid team cut
        gridTokenContract.transfer(financeAccount, _bscgridAmount);
    }

    function claimGridTokens(uint256 _cellId) public returns (bool) {
        require(address(gridTokenContract) != address(0), "gridTokenContract has not been set");
        require(address(cellContract) != address(0), "cellContract has not been set");

        (, address _owner, uint8 _team, , uint8 _cellStake) = getCellData(_cellId);

        AccessControlEnumerable _cellContractAccess = AccessControlEnumerable(address(cellContract));

        //deny claims from internal project contracts (e.g. to prevent auction contract accruing tokens it can never use)
        if (
            _cellContractAccess.hasRole(keccak256("ROLE_CORE_CONTRACT"), _owner) ||
            _cellContractAccess.hasRole(keccak256("ROLE_STAKE_DENYLIST"), _owner)
        ) {
            return false;
        }

        (, uint256 _teamEarningsPerStake) = cellContract.getTeamEarnings(_team);
        uint256 _lastTeamEarningsPerStake = cellContract.getCellLastTeamEarningsPerStake(_cellId);

        //calculate the total number of tokens the team has earned (per stake) since...
        //the last time this CELL claimed their cut
        uint256 _claimableTokens = _teamEarningsPerStake - _lastTeamEarningsPerStake;

        //CELL owner's cut is their % of the total team stake
        uint256 _cutToClaim = _claimableTokens * _cellStake;

        if (_cutToClaim == 0) {
            return false;
        }

        //update stored last team total earnings for this CELL
        cellContract.updateCellLastTeamEarningsPerStake(_cellId);

        //log the event
        emit TokensClaimed(_cellId, _owner, _cutToClaim, uint64(block.timestamp));

        //distribute CELL owner's cut
        gridTokenContract.transfer(_owner, _cutToClaim);

        return true;
    }

    function getClaimableGridTokens(uint256 _cellId) public view returns (uint256) {
        require(address(cellContract) != address(0), "cellContract has not been set");

        (, address _owner, uint8 _team, , uint8 _cellStake) = getCellData(_cellId);

        AccessControlEnumerable _cellContractAccess = AccessControlEnumerable(address(cellContract));

        //deny claims from internal project contracts (e.g. to prevent auction contract accruing tokens it can never use)
        if (
            _cellContractAccess.hasRole(keccak256("ROLE_CORE_CONTRACT"), _owner) ||
            _cellContractAccess.hasRole(keccak256("ROLE_STAKE_DENYLIST"), _owner)
        ) {
            return 0;
        }

        (, uint256 _teamEarningsPerStake) = cellContract.getTeamEarnings(_team);
        uint256 _lastTeamEarningsPerStake = cellContract.getCellLastTeamEarningsPerStake(_cellId);

        //calculate the total number of tokens the team has earned (per stake) since...
        //the last time this CELL claimed their cut
        uint256 _claimableTokens = _teamEarningsPerStake - _lastTeamEarningsPerStake;

        //CELL owner's cut is their % of the total team stake
        uint256 _cutToClaim = _claimableTokens * _cellStake;

        return _cutToClaim;
    }
}

